  true,\n\t\"url\": null,\n\t\"notes\": \"Federal law (5 U.S.C. 6103) establishes
  the following public holidays for Federal employees. Please note that most Federal
  employees work on a Monday through Friday schedule. For these employees, when a
  holiday falls on a nonworkday -- Saturday or Sunday -- the holiday usually is observed
  on Monday (if the holiday falls on Sunday) or Friday (if the holiday falls on Saturday).
  This calendar displays all federal holidays for the years 1997 to 2020. You may
  also import all of these dates into your calendar.\",\n\t\"license_title\": \"U.S.
